import React,{useSelector} from 'react';
import CarouselContainer from '../components/Carousel.Component'; 
import MainItem from '../components/MainItem.Component';
const Home = () => {
    const {me} = useSelector(selector => selector.user);
    return (
        <>
            <CarouselContainer/>
            <MainItem/>
        </>
    )
}

export default Home;
